import React, { useState, useMemo } from "react";
import './App.css';

const ExportData = () => {
  const [option, setOption] = useState("All");
  const [reviewer, setReviewer] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  const sites = useMemo(() => [
    "ABC Hospital",
    "Green Valley Medical Center", 
    "Sunnydale Hospital",
    "Riverbend Health Clinic",
    "Mountain Peak Hospital",
    "Lakeside Community Hospital",
  ], []);

  const visits = useMemo(() => [
    "Baseline", "Visit 1", "Visit 2", "Visit 3", "USV 1", "EOT"
  ], []);

  const reviewers = ["Reader 1", "Reader 2", "Adjudicator"];

  const renderCheckboxList = (items, title) => (
    <div className="checkbox-section">
      <div className="section-header">
        <h4>{title}</h4>
        <span className="item-count">{items.length} items</span>
      </div>
      <div className="search-box">
        <input 
          type="text" 
          placeholder="Search..." 
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="search-input"
        />
      </div>
      <div className="checkbox-list">
        {items.map((item, i) => (
          <label key={i} className="checkbox-item">
            <input type="checkbox" className="custom-checkbox" />
            <span className="checkmark"></span>
            <span className="item-text">{item}</span>
          </label>
        ))}
      </div>
    </div>
  );

  return (
    <div className="export-data-container">
      <div className="header">
        <div className="header-content">
          <div className="breadcrumb">
            <span className="breadcrumb-item">DTF</span>
            <span className="breadcrumb-separator">/</span>
            <span className="breadcrumb-item">Eligibility</span>
            <span className="breadcrumb-separator">/</span>
            <span className="breadcrumb-item active">Reviewer</span>
          </div>
          <h1 className="page-title">Export Data</h1>
        </div>
      </div>

      <div className="main-content">
        <div className="sidebar">
          <div className="menu-item">
            <span className="menu-text">DTF</span>
          </div>
          <div className="menu-item">
            <span className="menu-text">Eligibility</span>
          </div>
          <div className="menu-item active">
            <span className="menu-text">Reviewer</span>
          </div>
        </div>

        <div className="content-area">
          <div className="content-header">
            <h2>Data Setting</h2>
          </div>

          <div className="data-sections">
            <div className="section-grid">
              {[
                { title: "Site", data: sites, color: "#4CAF50" },
                { title: "Participant", data: Array.from({ length: 15 }, (_, i) => `Participant ${i + 1}`), color: "#2196F3" },
                { title: "Visit", data: visits, color: "#FF9800" },
                { title: "Form Version", data: ["Version 1", "Version 2", "Version 3"], color: "#9C27B0" },
                { title: "Item OID", data: ["OID 1 / Ver 1", "OID 2 / Ver 2", "OID 3 / Ver 3"], color: "#F44336" }
              ].map((section, idx) => (
                <div key={idx} className="data-section" style={{borderLeft: `4px solid ${section.color}`}}>
                  {renderCheckboxList(section.data, section.title)}
                </div>
              ))}
            </div>

            <div className="options-section">
              <div className="option-group">
                <h3>Option</h3>
                <div className="radio-group">
                  {["All", "Softlock", "Without softlock"].map(opt => (
                    <label key={opt} className="radio-item">
                      <input
                        type="radio"
                        name="option"
                        value={opt}
                        checked={option === opt}
                        onChange={() => setOption(opt)}
                        className="custom-radio"
                      />
                      <span className="radio-checkmark"></span>
                      <span className="radio-text">{opt}</span>
                    </label>
                  ))}
                </div>
              </div>

              <div className="option-group">
                <h3>Reviewer</h3>
                <div className="checkbox-group">
                  {reviewers.map(r => (
                    <label key={r} className="checkbox-item">
                      <input
                        type="checkbox"
                        value={r}
                        checked={reviewer.includes(r)}
                        onChange={(e) => {
                          const checked = e.target.checked;
                          setReviewer(prev =>
                            checked ? [...prev, r] : prev.filter(val => val !== r)
                          );
                        }}
                        className="custom-checkbox"
                      />
                      <span className="checkmark"></span>
                      <span className="item-text">{r}</span>
                    </label>
                  ))}
                </div>
              </div>
            </div>
          </div>

          <div className="action-buttons">
            <button className="btn btn-secondary">Preview</button>
            <button className="btn btn-secondary">Save</button>
            <button className="btn btn-primary">Export</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ExportData;
